import React from "react";
import { Box } from "@material-ui/core";


function CashOut() {
    return (
        <Box
            sx={{
            backgroundColor: '#ed7e81',
            color: 'white',
            border: '1px solid #ead9da',
            borderRadius: '15px',
            padding: '5px'
        }}
        >
            Cashout
        </Box>
    )
};

export default CashOut;
